import { Book } from "./Book";

export function BookList({ books }) {
  return (
    <div className="book-list-container">
      <h2 className="book-list-title">Giap's BookList</h2>
      <ul className="book-list">
        {books.map((book) => (
          <Book
            key={book.title}
            title={book.title}
            year={book.publishedYear}
            author={book.author}
            theme={book.theme}
          />
        ))}
      </ul>
    </div>
  );
}
